import { AppBar, Typography, IconButton, Toolbar, Button ,Box, Drawer} from '@mui/material';
import React, { useState } from 'react'
import MenuRoundedIcon from '@mui/icons-material/MenuRounded';
import { findAllByDisplayValue } from '@testing-library/react';



export default function Sidebar() {
  const [opem ,setOpem] = useState(false)
  return (
// HEADER
  <AppBar position='fixed'>

      <Toolbar>

{/*Button for side bar  */}
      <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
           onClick={(e) => {
             e.preventDefault()
             setOpem(true)
           }}>
{/* ICON */}
            <MenuRoundedIcon />

          </IconButton>



          {/* SIDE BAR */}
      <Drawer
      variant="persistent"
      anchor="left"
      open={opem}>
        
        <IconButton
        size="large"
        edge="start"
        color="inherit"
        aria-label="menu"
        // sx={{ mr: 3 }}
        onClick={
          (e) => {
            e.preventDefault()
            setOpem(false)
            }
          }>
            <MenuRoundedIcon />
            
        </IconButton>
      
      </Drawer>

    </Toolbar>

  </AppBar>




   
  )
}
